import Head from 'next/head';
import PaypalButton from "../src/PaypalButton"

export default function PaypalBtn() {
  return (
      <div>
          <Head>
            <script src="https://www.paypal.com/sdk/js?client-id=sb&currency=USD"></script>
          </Head>
      <PaypalButton></PaypalButton>
      </div>
  )
}
